<H1><A NAME="c4033"></A><SUP></SUP>Compiler Warning (level 1) C4033</H1>

<P class=dt><B>'function' must return a value</B></P>

<P>Only functions with a return type of <B>void</B> can use the return command without an accompanying return value.</P>
